import React, { Component } from 'react'
import {Button, Row, Col} from 'react-bootstrap'
import NewAccom from './NewAccom.js'

export default class AccomCard extends Component {
    state = {
        location: this.props.accommodations.map(accommodation => accommodation.location),
        date: this.props.accommodations.map(accommodation => accommodation.date)
    }

    // newAccomHandler = (data) => {
    //     this.setState({location: [...this.state.location, data.location]})
    //     this.setState({date: [...this.state.date, data.date]})
    // }

    render() {
        return (
            <div>
            {this.state.location} <br/> 
            {this.state.date} <br/> 
            <Row> 
                {console.log}
                <Col><Button> <NewAccom event_id={this.props.event.id} newAccom={this.props.newAccomHandler}/> </Button></Col>                 
            </Row>
            </div>
        )
    }
}
